import React, { useState } from 'react';
// import './style1.css'; // Import your CSS file

function App() {
    const [signInVisible, setSignInVisible] = useState(true);

    const toggleSignIn = () => {
        setSignInVisible(!signInVisible);
    };

    const handleSignIn = (event) => {
        event.preventDefault();
        // Add your sign-in logic here
    };

    const handleSignUp = (event) => {
        event.preventDefault();
        // Add your sign-up logic here
    };

    const handleInputChange = (event) => {
        // Handle input changes
    };

    return (
        <div id="container">
            <div id="buttons">
                <button id="sign_in_button" onClick={toggleSignIn}>
                    {signInVisible ? 'Sign-in' : 'Sign-Up'}
                </button>
            </div>
            {signInVisible ? (
                <div id="sign-in">
                    <form id="log_in" onSubmit={handleSignIn}>
                        <h2 id="sign_in">SIGN-IN</h2>
                        <label htmlFor="username">Username</label>
                        <input type="text" id="username" placeholder="username" onChange={handleInputChange} />

                        <label htmlFor="password">Password</label>
                        <input type="password" id="password" placeholder="password" onChange={handleInputChange} />

                        <input type="submit" value="Log-in" style={{ marginTop: '5px', marginBottom: '5px' }} />
                    </form>
                </div>
            ) : (
                <div id="sign-up">
                    <form id="register_details" onSubmit={handleSignUp}>
                        <h2 id="sign_up_head">SIGN-UP</h2>
                        <label htmlFor="company_name">Company Name</label>
                        <input type="text" id="company_name" placeholder="company Name" onChange={handleInputChange} />

                        <label htmlFor="location">State Location</label>
                        <select id="location" onChange={handleInputChange}>
                            <option value="" selected disabled>Select a state/UT</option>
                            {/* Options */}
                        </select>

                        <label htmlFor="pan_number">PAN Number</label>
                        <input type="text" id="pan_number" placeholder="PAN Number" onChange={handleInputChange} />

                        <label htmlFor="no_of_entity">Number of Entity of same PAN number</label>
                        <input type="text" id="no_of_entity" placeholder="NO of org with same PAN Number" onChange={handleInputChange} />

                        <label htmlFor="govt">Does your org. belongs to GOVT. bodies</label>
                        <select id="govt" onChange={handleInputChange}>
                            <option value="Z">No</option>
                            <option value="">Yes</option>
                        </select>

                        <label htmlFor="gst_num">GST Number</label>
                        <input type="text" id="gst_num" placeholder="GST Number" onChange={handleInputChange} />

                        <input type="submit" value="Register" />
                    </form>
                </div>
            )}
        </div>
    );
}

export default App;
